import React, { Component } from 'react';
import Header from '../component/Header';
import Row from '../component/Row';
import Footer from '../component/Footer';

class Skills extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tech: [
        'JavaScript',
        'React',
        'Express',
        'Node JS',
        'Docker',
        'D3',
        'git',
        'Bootstrap',
        'Webpack',
        'Styled Components',
        'Rest API',
      ],
    };
  }

  render() {
    return (
      <div className="App">
        <Header title="Skills"></Header>
        <Row
          name={this.state.tech.slice(0, 3)}
          tech={['', '', '']}
          src={['', '', '']}
        ></Row>
        <Row name={this.state.tech.slice(3, 6)}></Row>
        <Row name={this.state.tech.slice(6, 9)}></Row>
        <Row name={this.state.tech.slice(9, 11)}></Row>

        <Footer></Footer>
      </div>
    );
  }
}

export default Skills;
